import '../collection-item/collection-item.styles.scss';

const CollectionItem = (name,id,items)=> {
    return (
        <div className="collection-item">
            <h1>{elem.title.toUpperCase()}</h1>
            {
                elem.items.filter((item,i) => i < 4).map((item)=>(
                    <p>{item.name}</p>
                ))
            }
        </div>
    );

}
export default CollectionItem;
